description:
Week 21 of TEMPLATE, a new digital comics series from QAM Comics. Fans of Thrillbent, Monkeybrain, or DC Digital First style comics should definitely check it out. 

Our first Kickstarter campaign didn't go so hot, so we've shifted our focus and started a new campaign. Instead of aiming for retail, we simply want to get print copies in the hands of people who want one. That has allowed us to drastically reduce our goal, so all we're looking to raise this time around is $1000. We hope you guys can help out if you have liked the comic. Here is the link to the new project page:
 &lt;a href=&quot;
http://www.kickstarter.com/projects/qmiles/template-a-cyberpunk-action-thriller&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.kickstarter.com/projects/qmiles/template-a-cyberpunk-action-thriller&lt;/a&gt;

So score some cool stuff and help us get TEMPLATE into the hands of more people as well. If this works, we can potentially even start work on a Volume 2, so spread the word if you like what we're doing!

Thanks!

Q
